// codeFrequencyService.js

import setCodeFrequency from "../redux/codeFrequencySlice";
import { store } from "../redux/store";

export const fetchCodeFrequency = async (owner, repoName) => {
  try {
    const response = await fetch(
      ` https://gist.github.com/jayeshanandani/749d789a4221a4a571c4b9a4ebe8c76f`
    );
    const data = await response.json();
    store.dispatch(setCodeFrequency(data));
  } catch (error) {}
};
